#[repr(C)]
pub struct CBTreeMapData<T> {
    pub key: u8,
    pub val: T,
}

#[repr(C)]
pub struct CBTreeMap<A> {
    pub data: *const CBTreeMapData<A>,
    pub len: usize,
}

impl<A> CBTreeMap<A> {
    pub fn new() -> Self {
        CBTreeMap {
            len: 0,
            data: std::ptr::null(),
        }
    }

    pub fn from<B>(btree_map: &BTreeMap<u8, B>) -> Self
    where
        A: From<B>,
        B: Clone,
    {
        let mut out: Vec<CBTreeMapData<A>> = Vec::new();
        for (k, v) in btree_map.iter() {
            let map = CBTreeMapData {
                key: *k,
                val: A::from(v.clone()),
            };
            out.push(map);
        }
        let len = out.len();
        let data =
            Box::into_raw(out.into_boxed_slice()) as *const CBTreeMapData<A>;
        CBTreeMap { data, len }
    }

    pub fn to_inner<B>(&self) -> BTreeMap<u8, B>
    where
        A: ToInner<B>,
    {
        let mut btree_map: BTreeMap<u8, B> = BTreeMap::new();
        let elements =
            unsafe { std::slice::from_raw_parts(self.data, self.len) };
        for el in elements.iter() {
            let key = el.key;
            let val = el.val.to_inner();
            btree_map.insert(key, val);
        }
        btree_map
    }
}

